import React from "react";
import './Result.css';
import './OneHash'

import Header from "./Header";

var mdp=localStorage.getItem("pwd");

function Result() {
    return (
        <div className="App">
            <Header/>
        <header className="App-header">
            <p>The result is : </p>
            {mdp}
        </header>
        </div>
    );
}

export default Result;
